        pcc_capture_t *const p = (pcc_capture_t *)capt;
        pcc_char_array__resize(ctx->auxil, &p->string, n + 1);
        if (n > 0) memcpy(p->string.buf, ctx->buffer.buf + capt->range.start, n);
